    borderBottomColor: 'black',
    
  },
  h1: {
    textTransform: "uppercase",
    fontSize: "1.3em",
    color: "white"
  },
  h2: {
    fontSize: "0.8em"
  }
};

const Nav = () => (
  <nav style={styles.nav}>
    <a href="">
      <h1 style={styles.h1}>Logo/Name goes here</h1>
    </a>
  </nav>
);

